import AboutMe from './components/aboutme'
// import Timeline from './components/timeline'

class App extends Component {
  render() {
  return (
    <div>
      <Sidebar></Sidebar>
        <div>
          <Intro></Intro>
        </div>
    </div>
    );
  }
}

export default App;
